implicit class DataframeOps(df: org.apache.spark.sql.DataFrame){
    def path_to_ouput(filename: String): String =  s"s3n://sierra-leone-lake/blob/AGGREGATED_CDRS/africell/flowminder/$filename"
    def saveToS3(filename: String) : Unit = df.write.format("csv").option("header", "true").save(path_to_ouput(filename))
}
